    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Archie Carr NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Archie Carr NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information on plan development and
    management direction, and strategies for plan implementation. Key planning issues
    include: wildlife and habitat management, resource protection, visitor services,
    and refuge administration.",nt"license_title": "License Not Specified",nt"extras":
